import React from 'react';

class forbidden extends React.Component{


    render(){
        
        return (<div>
             <style type="text/css">
            {`.navbar {display: none}`}
            </style>
            
            <h2>403</h2>
            <h2>Not this time, access forbidden!</h2>
            
        </div>)
    }

}

export default forbidden;
